package ex.entities;

public class Service {
	int id;
	String name;
	public Service() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Service(String name) {
		super();
		this.name = name;
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	
	
}
